import React from "react";

const partners = ["네이버", "카카오", "WAUG", "KKday", "클룩"];

const PartnerWidget: React.FC = () => {
  return (
    <div className="bg-white/80 backdrop-blur-sm rounded-2xl p-6 shadow-lg border border-gray-100">
      <h3 className="text-lg font-semibold text-gray-800 mb-4 text-center">제휴사</h3>
      <div className="flex flex-wrap justify-center gap-6">
        {partners.map((name, idx) => (
          <div 
            key={idx} 
            className="px-4 py-2 bg-gradient-to-r from-blue-50 to-cyan-50 rounded-xl border border-blue-100 text-blue-700 font-medium text-sm hover:from-blue-100 hover:to-cyan-100 transition-all duration-200 cursor-pointer"
          >
            {name}
          </div>
        ))}
      </div>
    </div>
  );
};

export default PartnerWidget;
